    W += c[11]*15.035060; /*CH3 */
    W += c[12]*16.043030; /*CH4 */
    W += c[13]*29.018520; /*HCO */
    W += c[14]*30.026490; /*CH2O */
    W += c[15]*31.034460; /*CH3O */
    W += c[16]*28.010550; /*CO */
    W += c[17]*44.009950; /*CO2 */
    W += c[18]*26.038240; /*C2H2 */
    W += c[19]*27.046210; /*C2H3 */
