    dqdci =  + k_f*sc[8];
    J[2434] += dqdci;             /* dwdot[HO2]/d[SXC12H25] */
    J[2438] -= dqdci;             /* dwdot[O2]/d[SXC12H25] */
    J[2475] -= dqdci;             /* dwdot[SXC12H25]/d[SXC12H25] */
