    /*a non-third-body and non-pressure-fall-off reaction */
    /* forward */
    phi_f = sc[8]*sc[49];
    k_f = 1e-06 * 46000000000
                * exp(0 * tc[0] - 0.50321666580472 * (0) * invT);
    dlnkfdT = 0 * invT + 0.50321666580472 *  0  * invT2;
