    phi_r = sc[3]*sc[51];
    Kc = refC * exp(-g_RT[3] + g_RT[50] - g_RT[51]);
    k_r = k_f / Kc;
    dlnKcdT = invT * (-(h_RT[50]) + (h_RT[3] + h_RT[51]) - 1.000000);
    dkrdT = (dlnkfdT - dlnKcdT)*k_r;
